import React from 'react';
import Home from "./Home";
import About from "./About";
import Service from "./Service";
import Contact from "./Contact";
import { Switch, Route } from "react-router-dom";


const App = () => {
    return ( <
        >
        <
        Switch >
        <
        Route path = "/"
        component = { Home }
        /> <
        Route path = "/About"
        component = { About }
        /> <
        Route path = "/Service"
        component = { Service }
        /> <
        Route path = "/Contact"
        component = { Contact }
        /> <
        Home / >
        <
        /Switch>  <
        />
    );
};



export default App;
